description:
Rocky 3 1982

Verenigde Staten
Actie / Drama
99 minuten

geregisseerd door Sylvester Stallone
met Sylvester Stallone, Carl Weathers en Mr. T

Na Apollo Creed verslagen te hebben heeft Rocky eindelijk de tijd 
om het eens wat rustiger aan te doen. Hij raakt bevriend met Creed 
en brengt meer tijd met zijn vrouw door. Wanneer hij echter verslagen 
wordt door de nieuweling Clubber Lang wil niemand meer iets van hem weten. 
Creed weet Rocky over te halen om een rematch te organiseren
